import { BrowserRouter, Route, Routes } from 'react-router-dom';
import './App.css';
import HomePage from './components/HomePage';
import Login from './components/Login';
function App() {
  return (
    <div>
      <BrowserRouter>
      <Routes>
          <Route path="/homepage" element={<HomePage />} />    
          <Route path="/login" element={<Login />} />
      </Routes>
    </BrowserRouter>
    </div>
  );
}

export default App;
